import React, { useState, useRef, useEffect } from "react";
import { Form, Button, Toast } from "react-bootstrap";
import LockIcon from "@material-ui/icons/Lock";
import axios from "axios";
import "../styles.css";

const ResetPassword = ({ match, history }) => {
  const [data, setData] = useState({ email: "", code: match.params.code || "", password: "" });
  const [status, setStatus] = useState({ val: 0, msg: "", type: "" });
  const [inputType, setInputType] = useState("password");
  const isMounted = useRef(true);

  useEffect(() => () => { isMounted.current = false; }, []);

  const handleChange = (e) => setData({ ...data, [e.target.name]: e.target.value });

  const togglePassword = () => setInputType(inputType === "password" ? "text" : "password");

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!data.email || !data.password || !data.code) return alert("Please fill all fields");

    const config = { headers: { "Content-Type": "application/json" } };
    try {
      const res = await axios.post("https://foodeazy.herokuapp.com/reset-password", data, config);
      if (isMounted.current) setStatus({ val: 1, msg: res.data.message || res.data, type: "darkGreen" });
      setTimeout(() => { if (isMounted.current) history.push("/auth"); }, 3000);
    } catch (err) {
      if (isMounted.current)
        setStatus({ val: 1, msg: err.response?.data?.message || "Something went wrong", type: "red" });
      setTimeout(() => { if (isMounted.current) setStatus({ val: 0, msg: "", type: "" }); }, 3000);
    }
  };

  const Alert = () => {
    if (!status.val) return null;
    const msg = typeof status.msg === "object" ? JSON.stringify(status.msg) : status.msg;
    return (
      <Toast
        style={{
          position: "fixed",
          top: "20vh",
          left: "50%",
          transform: "translateX(-50%)",
          zIndex: "999999",
          minWidth: "300px",
          borderRadius: "10px",
        }}
        className={status.type === "darkGreen" ? "bg-success text-white" : "bg-danger text-white"}
      >
        <Toast.Body style={{ textAlign: "center", fontWeight: "bold" }}>{msg}</Toast.Body>
      </Toast>
    );
  };

  return (
    <div className="forget">
      {status.val && <Alert />}
      <h4 style={{ marginTop: "6vh", fontFamily: "Mulish" }}>Reset Password</h4>
      <p>
        <LockIcon style={{ fontSize: "1.2rem", color: "grey" }} />
        Enter your email, code, and new password to reset.
      </p>
      <Form onSubmit={handleSubmit}>
        <Form.Group>
          <Form.Label>Email</Form.Label>
          <Form.Control type="email" name="email" value={data.email} onChange={handleChange} />
        </Form.Group>
        <Form.Group>
          <Form.Label>Code</Form.Label>
          <Form.Control type="text" name="code" value={data.code} onChange={handleChange} />
        </Form.Group>
        <Form.Group>
          <Form.Label>Password</Form.Label>
          <Form.Control type={inputType} name="password" value={data.password} onChange={handleChange} />
          <Button type="button" onClick={togglePassword}>{inputType === "password" ? "Show" : "Hide"}</Button>
        </Form.Group>
        <Button type="submit" style={{ borderRadius: "1vh", textTransform: "capitalize" }}>Reset Password</Button>
      </Form>
    </div>
  );
};

export default ResetPassword;
